import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  background-color: lightblue;
  height: 100vh;
  width: 100vw;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;

const DashboardPage = () => {
  return (
    <Container>
      <h1>Dashboard</h1>
    </Container>
  )
}

export default DashboardPage
